import React from "react";
import {observer} from "mobx-react-lite";
import { Rating } from "@mui/material";

import info_img from "../../assets/img/service_info.png";

const ServiceInfo = observer(() => {
  const service = {
    id: 1,
    title: "d,njkdkjfn",
    description: "ewlfknkle",
    price: 32,
    rating: 5,
  };
  let ratingAvailable = true;
  return (
    <div className='container serviceinfo-container'>
      <img src={info_img} alt='service_img' />
      <div className='service_info'>
        <h2>{service.title}</h2>
        <p>{service.price}</p>
        <Rating readOnly={ratingAvailable} value={service.rating}></Rating>
        <p>{service.description}</p>
      </div>
    </div>
  );
});

export default ServiceInfo;
